import react from 'react'
import cx from 'classnames'

// import specific style here
import hexagonStyles from 'hexagon.module.scss';

const Hexagon = () => {
    return (
        <div className={hexagonStyles.hexagonContainer}>
            <div className={hexagonStyles.top}></div>
            <div className={hexagonStyles.middle}></div>
            <div className={hexagonStyles.bottom}></div>
        </div>
    )
}

export default Hexagon;
